Pisowskie ku...y skręciły wybory.
Krótko i na temat.
Tylu sygnałów co na X już dawno, nigdzie nie widzialem.
To co ludzie piszą, ludzie z komisji to włos się jeży na głowie.
Całą tą PKW to w kosmos wysłać.
@GiertychRoman
@trzaskowski_
